import React from 'react';
import '../../App.css';

export default function Products() {
  return <>
  <div style={{ width: '750px' }}>
      <h1 style={{ fontSize: '25px' }}>Simple, transparent pricing that scales with you</h1>
      <p style={{ fontSize: '14px' }}>With font size 24</p>
    </div>
  </>;
}
